// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Lottery {
    // State variables
    address public manager;
    address payable[] public candidates;
    address payable public winner;

    // Constructor to set the manager
    constructor() {
        manager = msg.sender;
    }

    // Function to participate in the lottery
    function participate() public payable {
        require(msg.value > 0, "A participation fee is required.");
        candidates.push(payable(msg.sender));
    }

    // Function to pick a winner (can be called only by the manager)
    function pickWinner() public onlyManager {
        require(candidates.length >= 2, "Not enough candidates to pick a winner.");
        uint index = random() % candidates.length;
        winner = candidates[index];
        winner.transfer(address(this).balance);
        // Reset the candidates array for the next round
        candidates = new address payable[] (0);
    }

    // Function to receive ether from participants
    function receiveEther() external payable {
        require(msg.value == 1 ether, "Participation requires exactly 1 ether.");
        candidates.push(payable(msg.sender));
    }

    // Function to get the balance of the contract (only callable by the manager)
    function getBalance() public view onlyManager returns (uint) {
        return address(this).balance;
    }

    // Modifier to allow only manager to call certain functions
    modifier onlyManager() {
        require(msg.sender == manager, "Only the manager can call this function.");
        _;
    }

    // Function to generate a pseudo-random number (not secure for production use)
    function random() private view returns (uint) {
        return uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp, candidates)));
    }
}

